const getFileType = (suffix) => {
    if(suffix == undefined){
        return 2
    }

    
    if(typeof suffix == "string"){
        suffix = suffix.toLowerCase()
    }
    const fileType = FILE_TYPE[suffix] 
    return  fileType == undefined ? 2 : fileType

}

